import React, { useState } from "react";
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import MaterialCommunityIcons from 'react-native-vector-icons/MaterialCommunityIcons';
import { StyleSheet,  View,Image,Text, BlurView} from "react-native";

const Tab = createBottomTabNavigator();

export default function Dashboard() {
   const [user, setUser] = React.useState('New User'); 
  
  return (
    <Tab.Navigator 

    initialRouteName="Home"
    screenOptions={{
      tabBarShowLabel: false,
      headerShown: false,
      tabBarStyle: { position: 'absolute', backgroundColor: "#6C63FF", height: 70, borderRadius: 5 },
      tabBarActiveTintColor: '#d4d4d4',
    }}
      >
            <Tab.Screen 
                    name="Profile" 
                    component={Profile}   
                    options={{
                    tabBarLabel: 'Profile',
                    tabBarIcon: () => (
                        <>
                            <MaterialCommunityIcons name="account" color="#fff" size={35} />
                            <Text style={styles.navigationText}>Profile</Text>                         
                        </>
                    ),
                    }}
            />
            <Tab.Screen 
                    name="Home" 
                    component={DashboardItems}   
                    options={{
                    tabBarLabel: 'Home',
                    tabBarIcon: () => (
                        <>
                            <MaterialCommunityIcons name="home" color="#fff" size={35} />
                            <Text style={styles.navigationText}>Home</Text>                         
                        </>
                    ),
                    }}
            />
            <Tab.Screen 
                    name="Reports" 
                    component={DashboardItems}   
                    options={{
                    tabBarLabel: 'Reports',
                    tabBarIcon: () => (
                        <>
                            <MaterialCommunityIcons name="alpha-r-box" color="#fff" size={35} />
                            <Text style={styles.navigationText}>Reports</Text>                         
                        </>
                    ),
                    }}
            />  
            <Tab.Screen 
                    name="Alerts" 
                    component={DashboardItems}   
                    options={{
                    tabBarLabel: 'Alerts',
                    tabBarIcon: () => (
                        <>
                            <MaterialCommunityIcons name="bell" color="#fff" size={35} />
                            <Text style={styles.navigationText}>Alerts</Text>                         
                        </>
                    ),
                    }}
            />    
    </Tab.Navigator>
  );
}
 
const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: "#fff",
    alignItems: "center",
    justifyContent: "center",
  },
 
  image: {
    marginBottom: 40,
    width: 150,
    height: 150
  },

  heroText:{
    fontSize: 30,
    fontWeight: 'bold',
    marginTop: -50,
    marginBottom: 20,    
  },
  navigationText:{
    color: "#fff"
  }
});
